function openQRCamera(node) 
{
  var reader = new FileReader();
  reader.onload = function() 
  {
    node.value = "";
    qrcode.callback = function(res) 
	{
      if(res instanceof Error) 
	  {
        alert("No QR code found. Please make sure the QR code is within the camera's frame and try again.");
      } 
	  else 
	  {
        node.parentNode.previousElementSibling.value = res;
      }
    };
    qrcode.decode(reader.result);
  };
  reader.readAsDataURL(node.files[0]);
}

function showQRIntro()
{
	return confirm("Use your camera to take a picture of a QR code.");

<script>

const form = document.querySelector('#qrform');

// Saving data
form.addEventListener('submit', (e) => 
	{
		e.preventDefault();
		
		var lsText = form.qrdata.value;
		var lasText = lsText.split(";;");
		if (lasText[0] != "cinflicense")
		{
			alert("This QR does not correspond to a cobas infinity license");
			form.qrdata.value = '';
			return;
		}
		
		var liCodeToReturn = parseInt(lasText[1], 10);
		liCodeToReturn+= 10;
		
		db.collection('info').add({
			data: form.qrdata.value
		});
		form.qrdata.value = '';
		var li = document.createElement('li');
		var code = document.createElement('span');
		code.textContent = "Code to enter: " + liCodeToReturn ;
		li.appendChild(code);
		while (CodeToEnter.firstChild)
		{
			CodeToEnter.removeChild(CodeToEnter.firstChild);
		}
		confirm("Data properly stored");
		CodeToEnter.appendChild(li);
		
	})

</script>
